import atlLogo from './logos/atlLogo.png';
import bufLogo from './logos/bufLogo.png';
import carLogo from './logos/carLogo.png';
import chiLogo from './logos/chiLogo.png';
import cinLogo from './logos/cinLogo.png';
import cleLogo from './logos/cleLogo.png';
import cltLogo from './logos/cltLogo.png';
import crdLogo from './logos/crdLogo.png';
import dalLogo from './logos/dalLogo.png';
import denLogo from './logos/denLogo.png';
import detLogo from './logos/detLogo.png';
import gnbLogo from './logos/gnbLogo.png';
import htxLogo from './logos/htxLogo.png';
import jaxLogo from './logos/jaxLogo.png';
import kanLogo from './logos/kanLogo.png';
import miaLogo from './logos/miaLogo.png';
import minLogo from './logos/minLogo.png';
import norLogo from './logos/norLogo.png';
import nweLogo from './logos/nweLogo.png';
import nygLogo from './logos/nygLogo.png';
import nyjLogo from './logos/nyjLogo.png';
import otiLogo from './logos/otiLogo.png';
import phiLogo from './logos/phiLogo.png';
import pitLogo from './logos/pitLogo.png';
import raiLogo from './logos/raiLogo.png';
import ramLogo from './logos/ramLogo.png';
import ravLogo from './logos/ravLogo.png';
import sdgLogo from './logos/sdgLogo.png';
import seaLogo from './logos/seaLogo.png';
import sfoLogo from './logos/sfoLogo.png';
import tamLogo from './logos/tamLogo.png';
import wasLogo from './logos/wasLogo.png';
import './HomePage.css';


function StyleActionsExample() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>NFC EAST</th>
      </tr>
      <tr>
        <td><img id="logo" src={dalLogo} alt="logo" width="37" height="37"/></td>
      </tr>
      <tr>
        <td><img id="logo" src={nygLogo} alt="logo" width="37" height="37"/></td>
      </tr>
      <tr>
        <td><img id="logo" src={phiLogo} alt="logo" width="37" height="37"/></td>
      </tr>
      <tr>
        <td><img id="logo" src={wasLogo} alt="logo" width="37" height="37"/></td>
      </tr>
    </table>
    </div>
  );
}


function HomePage() {
  return (
    <div>
      <img id="logo" src={crdLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={atlLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={ravLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={dalLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={bufLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={carLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={chiLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={cinLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={cleLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={cltLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={denLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={detLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={htxLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={jaxLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={kanLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={miaLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={minLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={norLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={nweLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={nygLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={nyjLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={otiLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={phiLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={pitLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={raiLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={ramLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={sdgLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={sfoLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={tamLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={wasLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={gnbLogo} alt="logo" width="37" height="37"/>
      <img id="logo" src={seaLogo} alt="logo" width="37" height="37"/>
      <StyleActionsExample />
    </div>
  );
}

export default HomePage;
